// Bakong KHQR Payment Handler
// Uses Bakong API for secure payment processing with Telegram notifications

class BakongPaymentHandler {
    constructor() {
        this.apiBaseUrl = 'https://api.bakong-api.online';
        this.bakongId = 'ansenghong@aclb';
        this.merchantName = 'ROVYTOP';

        // Telegram Bot Configuration
        this.telegramBotToken = '8499942561:AAFZD63-IuBbJqtuLSkLuKFHJ8_SZjxLzQ4';
        this.telegramGroupId = '-4911328110';
        this.telegramApiUrl = 'https://api.telegram.org/bot' + this.telegramBotToken;
    }

    async sendTelegramNotification(userid, zoneid, amount, transactionId, status) {
        // Send notification asynchronously without blocking
        setTimeout(async () => {
            try {
                const diamondMap = {
                    '0.25': '11 Diamond',
                    '0.50': '22 Diamond',
                    '1.4': '86 Diamond',
                    '1.90': '112 Diamond',
                    '2.80': '172 Diamond',
                    '3.70': '223 Diamond',
                    '4.00': '257 Diamond',
                    '5.50': '343 Diamond',
                    '7.00': '429 Diamond',
                    '8.00': '514 Diamond',
                    '8.50': '570 Diamond',
                    '9.00': '600 Diamond',
                    '10.50': '706 Diamond',
                    '14.00': '878 Diamond',
                    '15.00': '963 Diamond',
                    '16.00': '1046 Diamond',
                    '21.00': '1412 Diamond',
                    '23.50': '1584 Diamond',
                    '32.00': '2195 Diamond',
                    '52.00': '3688 Diamond',
                    '78.00': '5532 Diamond',
                    '86.00': '6046 Diamond',
                    '109': '7727 Diamond',
                    '133': '9288 Diamond',
                    '6.00': 'Weekly Pass',
                    '10.00': 'Twilight Pass',
                    '1.80': 'Weekly Pass'
                };

                const itemName = diamondMap[amount.toString()] || `$${amount}`;

                const message = `‚úÖ Payment Confirmed!\n\nüì± Order Details:\n‚Ä¢ User ID: ${userid}\n‚Ä¢ Zone ID: ${zoneid}\n‚Ä¢ Item: ${itemName}\n‚Ä¢ Amount: $${amount}\n‚Ä¢ Transaction: ${transactionId}\n‚Ä¢ Status: ${status}\n‚Ä¢ Time: ${new Date().toLocaleString()}`;

                // Use CORS proxy for Telegram API to avoid CORS issues
                const corsProxy = 'https://api.allorigins.win/raw?url=';
                const telegramUrl = encodeURIComponent(`${this.telegramApiUrl}/sendMessage?chat_id=${this.telegramGroupId}&text=${encodeURIComponent(message)}&parse_mode=HTML`);

                const response = await fetch(`${corsProxy}${telegramUrl}`);
                console.log('Telegram notification sent:', response.status);
                return true;
            } catch (error) {
                console.error('Telegram notification error:', error);
                // Fail silently - don't block user experience
                return false;
            }
        }, 100);
        return true;
    }

    async generateQRCode(amount, userid, zoneid, paymentMethod) {
        try {
            // Call Bakong API to create QR code
            const createUrl = `${this.apiBaseUrl}/khqr/create?amount=${amount}&bakongid=${this.bakongId}&merchantname=${this.merchantName}`;

            const response = await fetch(createUrl);

            if (!response.ok) {
                throw new Error(`API request failed: ${response.status}`);
            }

            const data = await response.json();

            // Store transaction details
            const transaction = {
                tran: data.tran,
                amount: amount,
                userid: userid,
                zoneid: zoneid,
                paymentMethod: paymentMethod,
                qrCodeUrl: data.qr,
                md5: data.md5,
                timestamp: new Date().toISOString(),
                status: 'pending'
            };

            // Save to localStorage
            this.saveTransaction(transaction);

            return transaction;
        } catch (error) {
            console.error('QR Generation Error:', error);
            throw new Error('Failed to generate payment QR code. Please try again.');
        }
    }

    async checkPaymentStatus(md5) {
        try {
            const checkUrl = `${this.apiBaseUrl}/check_by_md5?md5=${md5}&bakongid=${this.bakongId}`;

            const response = await fetch(checkUrl);

            if (!response.ok) {
                throw new Error(`Payment check failed: ${response.status}`);
            }

            const data = await response.json();

            // responseCode 0 means payment was successful
            return data.responseCode === 0;
        } catch (error) {
            console.error('Payment check error:', error);
            return false;
        }
    }

    saveTransaction(transaction) {
        const transactions = this.getTransactions();
        transactions.push(transaction);
        localStorage.setItem('bakong_transactions', JSON.stringify(transactions));
    }

    getTransactions() {
        const stored = localStorage.getItem('bakong_transactions');
        return stored ? JSON.parse(stored) : [];
    }

    getTransaction(billNumber) {
        const transactions = this.getTransactions();
        return transactions.find(t => t.billNumber === billNumber);
    }

    displayQRCode(transaction) {
        const modal = document.getElementById('myModal');
        const iframe = document.getElementById('resultIframe');

        // Create QR code page content with API-provided QR image
        const qrPageContent = `
<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>KHQR Payment</title>
    <style>
        body {
            font-family: Arial, sans-serif;
            display: flex;
            flex-direction: column;
            align-items: center;
            justify-content: center;
            min-height: 100vh;
            margin: 0;
            padding: 20px;
            background: linear-gradient(135deg, #667eea 0%, #764ba2 100%);
        }
        .payment-container {
            background: white;
            border-radius: 20px;
            padding: 30px;
            box-shadow: 0 10px 40px rgba(0,0,0,0.2);
            text-align: center;
            max-width: 400px;
            width: 100%;
        }
        h1 {
            color: #333;
            margin-bottom: 10px;
            font-size: 24px;
        }
        .amount {
            font-size: 36px;
            font-weight: bold;
            color: #667eea;
            margin: 20px 0;
        }
        #qrcode {
            margin: 20px auto;
            padding: 20px;
            background: white;
            border-radius: 10px;
            display: inline-block;
        }
        #qrcode img {
            width: 250px;
            height: 250px;
            border: 2px solid #eee;
            border-radius: 10px;
        }
        .instructions {
            color: #666;
            margin: 20px 0;
            font-size: 14px;
            line-height: 1.6;
        }
        .transaction-id {
            font-size: 12px;
            color: #999;
            margin-top: 20px;
        }
        .payment-methods {
            display: flex;
            justify-content: center;
            gap: 10px;
            margin: 20px 0;
        }
        .payment-methods img {
            height: 40px;
            opacity: 0.7;
        }
        .timer {
            font-size: 18px;
            color: #ff6b6b;
            font-weight: bold;
            margin: 15px 0;
        }
        .status {
            padding: 10px;
            border-radius: 5px;
            margin: 15px 0;
            font-weight: bold;
        }
        .status.pending {
            background: #fff3cd;
            color: #856404;
        }
        .status.success {
            background: #d4edda;
            color: #155724;
        }
        .status.checking {
            background: #d1ecf1;
            color: #0c5460;
        }
    </style>
</head>
<body>
    <div class="payment-container">
        <h1>üîí Secure Payment</h1>
        <div class="amount">$${transaction.amount}</div>

        <div class="payment-methods">
            <img src="/public/khqr-200h.webp" alt="KHQR">
            <img src="/public/abapay-200h.webp" alt="ABA Pay">
        </div>

        <div id="qrcode">
            <img src="${transaction.qrCodeUrl}" alt="Payment QR Code" />
        </div>

        <div class="instructions">
            üì± Scan this QR code with your banking app<br>
            (ABA Mobile, Wing, or any KHQR-enabled app)
        </div>

        <div class="status pending" id="status">‚è≥ Waiting for payment...</div>

        <div class="timer" id="timer">Expires in: 15:00</div>

        <div class="transaction-id">
            Transaction ID: ${transaction.tran}<br>
            User ID: ${transaction.userid} (Zone: ${transaction.zoneid})
        </div>
    </div>

    <script>
        // 15-minute countdown timer
        let timeLeft = 15 * 60; // 15 minutes in seconds
        const timerElement = document.getElementById('timer');
        const statusElement = document.getElementById('status');
        let paymentCompleted = false;

        const countdown = setInterval(() => {
            if (paymentCompleted) {
                clearInterval(countdown);
                return;
            }

            const minutes = Math.floor(timeLeft / 60);
            const seconds = timeLeft % 60;
            timerElement.textContent = \`Expires in: \${minutes}:\${seconds.toString().padStart(2, '0')}\`;

            if (timeLeft <= 0) {
                clearInterval(countdown);
                timerElement.textContent = 'Payment expired';
                timerElement.style.color = '#dc3545';
                statusElement.textContent = '‚ùå Payment expired';
                statusElement.className = 'status pending';
            }

            timeLeft--;
        }, 1000);

        // Check payment status every 5 seconds
        const md5 = '${transaction.md5}';
        let checkCount = 0;
        const maxChecks = 180; // Check for 15 minutes (180 * 5 seconds)

        const checkPayment = setInterval(async () => {
            // Stop checking if payment completed, time expired, or max checks reached
            if (paymentCompleted || timeLeft <= 0 || checkCount >= maxChecks) {
                clearInterval(checkPayment);
                return;
            }

            checkCount++;
            statusElement.textContent = 'üîç Checking payment status...';
            statusElement.className = 'status checking';

            try {
                // Call parent window's payment handler to check status
                const isPaid = await window.parent.bakongPayment.checkPaymentStatus(md5);

                if (isPaid) {
                    paymentCompleted = true;
                    clearInterval(checkPayment);
                    clearInterval(countdown);

                    statusElement.textContent = '‚úÖ Payment successful!';
                    statusElement.className = 'status success';
                    timerElement.textContent = 'Payment completed';
                    timerElement.style.color = '#28a745';

                    // Update transaction status in localStorage
                    window.parent.bakongPayment.updateTransactionStatus('${transaction.tran}', 'completed');

                    // Send Telegram notification
                    window.parent.bakongPayment.sendTelegramNotification(
                        '${transaction.userid}',
                        '${transaction.zoneid}',
                        '${transaction.amount}',
                        '${transaction.tran}',
                        'Completed'
                    );

                    // Notify user
                    setTimeout(() => {
                        alert('Payment successful! Diamonds will be added to your account within 10 minutes to 3 hours.');
                        window.parent.location.reload();
                    }, 2000);
                } else {
                    statusElement.textContent = '‚è≥ Waiting for payment...';
                    statusElement.className = 'status pending';
                }
            } catch (error) {
                console.error('Payment check error:', error);
                statusElement.textContent = '‚è≥ Waiting for payment...';
                statusElement.className = 'status pending';
            }
        }, 5000); // Check every 5 seconds
    </script>
</body>
</html>`;

        // Set iframe content
        iframe.srcdoc = qrPageContent;

        // Show modal
        modal.style.display = 'flex';
    }

    updateTransactionStatus(tranId, status) {
        const transactions = this.getTransactions();
        const transaction = transactions.find(t => t.tran === tranId);
        if (transaction) {
            transaction.status = status;
            transaction.completedAt = new Date().toISOString();
            localStorage.setItem('bakong_transactions', JSON.stringify(transactions));
        }
    }
}

// Global payment handler instance
window.bakongPayment = new BakongPaymentHandler();

// Global helper functions
let selectedPaymentMethod = 'khqr';

window.updateRadioValue = function(method) {
    selectedPaymentMethod = method;
};

window.showModal = async function() {
    // Get values
    const userId = document.getElementById('userid').value;
    const zoneId = document.getElementById('zoneid').value;
    const checkedRadio = document.querySelector('input[name="radio"]:checked');

    if (!userId || !zoneId) {
        alert('Please enter User ID and Zone ID');
        return;
    }

    if (!checkedRadio) {
        alert('Please select a diamond package');
        return;
    }

    const amount = checkedRadio.value;

    try {
        // Show loading state
        const modal = document.getElementById('myModal');
        const iframe = document.getElementById('resultIframe');
        iframe.srcdoc = '<div style="display:flex;align-items:center;justify-content:center;height:100vh;font-family:Arial;"><div style="text-align:center;"><div style="border:4px solid #f3f3f3;border-top:4px solid #667eea;border-radius:50%;width:40px;height:40px;animation:spin 1s linear infinite;margin:0 auto 20px;"></div><p>Generating payment QR code...</p></div></div><style>@keyframes spin{0%{transform:rotate(0deg)}100%{transform:rotate(360deg)}}</style>';
        modal.style.display = 'flex';

        // Generate QR code using the Bakong API
        const transaction = await window.bakongPayment.generateQRCode(
            amount, 
            userId, 
            zoneId, 
            selectedPaymentMethod
        );

        // Display the QR code with payment verification
        window.bakongPayment.displayQRCode(transaction);
    } catch (error) {
        console.error('Payment error:', error);
        alert('Failed to generate payment QR code. Please try again.');
        document.getElementById('myModal').style.display = 'none';
    }
};

